export function createUtilStore() {
    return {
        columns : [
            {
              title: "Image",
              dataIndex: "img",
              render: (img, title) => <img src={img} alt={title}/>
            },
            {
              title: "Title",
              dataIndex: "title",
              sorter: {
                compare: (a, b) => a.show - b.show,
                multiple: 4,
              },
            },
            {
              title: "Status",
              dataIndex: "status",
              sorter: {
                compare: (a, b) => a.status - b.status,
                multiple: 3,
              },
            },
            {
              title: "Rating",
              dataIndex: "rating",
              sorter: {
                compare: (a, b) => a.rating - b.rating,
                multiple: 2,
              },
            },
            {
              title: "Date Added",
              dataIndex: "created_dt",
              sorter: {
                compare: (a, b) => a.created_df - b.created_dt,
                multiple: 1,
              },
            },
          ]
    }
}
